import React from 'react';
import { View, StatusBar, FlatList, Image } from 'react-native';

// Components
import EmptyBasket from './EmptyBasket';

import { colors } from '../../styles';
import { Context } from '../../Provider';

function CartContainer() {
	return (
		<Context.Consumer>
			{(val) => {
				return (
					<View style={{ justifyContent: 'center', alignItems: 'center', backgroundColor: 'white', flex: 1 }}>
						<StatusBar backgroundColor={colors.mainColor} />

						{val.cart.length ? (
							<FlatList
								data={val.cart}
								renderItem={({ item }) => (
									<Image source={item.url} style={{ width: 200, height: 200 }} />
								)}
							/>
						) : (
							<EmptyBasket />
						)}
					</View>
				);
			}}
		</Context.Consumer>
	);
}

export default CartContainer;
